  [],\n\t\"num_tags\": 0,\n\t\"name\": \"rays-in-the-northern-gulf-of-mexico-aerial-survey-and-satellite-telemetry-2008-2012-ncei-access\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The dataset contains distribution and abundance
  data for rays in the Gulf of Mexico collected through aerialnsurveys and satellite
  telemetry. Aerial survey data includes the date, time, latitude and longitude wherenrays
  were observed, and number and species of rays observed during 32 surveys which took
  place from 2008 ton2011. Satellite telemetry data contains data for 11 cownose rays
  that were fitted with Smart Positioning ornTemperature satellite transmitters between
  March and November 2011. The satellite telemetry data includesninformation about
  the cownose rays that were tracked, including the location they were caught, disk
  length,ndisk width, weight, sex, the number of days that the satellite tag remained
  attached to the ray, thencalculated total distance traveled by each ray while fitted
  with the tag, and the calculated mean andnmaximum rate of movement for each ray
  while fitted with the satellite tag. The data from ARGOS that was usednto calculate
  total distance and rates of movement for the tagged cownose rays is included in
  this data setnand includes location date, satellite that received the signal, latitude,
  longitude, number of messagesnreceived and data ARGOS used to calculate the error
  ellipse for each location.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
